import React from 'react'
import styled from 'styled-components';
import lines from '../assets/lines.png'
import ParallaxBackground from '../components/ParallaxBackground'

let what = ' \n \n P \n H \n A \n S \n E \n \n \n O \n N \n E \n \n \n '

const Style = styled.div`
	display: flex;
	flex-direction: column;
	position: relative;
	width: 788px;
	height: 96vh;
	margin-left: auto;
	margin-right: auto;

	&::before {
		position: relative;
		margin-top: -46vh;
		margin-left: auto;
		margin-right: auto;
		content:'${what}';
		background-color: red;
		width: 10px;
		white-space: pre-line;
		line-height: 5rem;
	}
`;

function Timeline(props) {
	return (
		<Style>
			<ParallaxBackground src={lines} height='100%'>

			{props.children}
			</ParallaxBackground>
		</Style>
	)
}

export default Timeline;
